import React, { Component } from 'react';
import './Blayout.css'

class Blayout extends  Component {

    constructor(){
    	super()

    	this.state = {
    		items: this.props.items || []
    	}
    }

    render() {
    	return(
               <div>
               	{
               		this.state.items.map(item => {
               			<div key = {item.id}>
               				{
               					item.value
               				}
               			</div>
               		})
               	}
               </div>

    		);
    }


}


export default Blayout;
